import React from 'react';
import Variantcolorlist from './variantcolorlis'

const colorbox = (props) => 
{ 
    state= []
    state = {
        variantcolor: [
            {
                title: 'Primary Variant',
                colorcode: 'HEX #0077CC',
                class: 'bg-primary-variant'
            },
            {
                title: 'Secondary Variant',
                colorcode: 'HEX #0077CC',
                class: 'bg-secondary-variant'
            },
            {
                title: 'Dark BG Variant',
                colorcode: 'HEX #0077CC',
                class: 'bg-dark-bg-variant'
            },
        ]
     }
        return (
            <>
            <div className="col-md-4 ">
                <div className={["colorbox align-content-end " + props.class]}>
                    <div className="caption text-white">{props.colorcode}</div>
                    <div className="h5 text-white">{props.title}</div>
                </div>

             </div>
              <Variantcolorlist variantcolor={this.state.variantcolor}/>
              </>
        ); 

}

export default colorbox;
